import React, { useState } from "react";

import classes from "./SideNav.module.css";
import Button from "../custom-ux/Button";

export default function SideNav({ showFull, setShowFull }) {
  function expandHandler() {
    setShowFull(!showFull);
  }

  return (
    <div
      className={`${classes.sideNav} ${showFull && classes.expandedSideNav}`}
    >
      <Button onClick={expandHandler}>
        Click to {showFull ? "Shrink" : "Expand"}
      </Button>
      SideNav
    </div>
  );
}
